import { Component, OnInit } from '@angular/core';
import { FormBuilder, Validators } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { AuthService } from '../../../../core/services/auth.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css'],
})
export class LoginComponent implements OnInit {
  loading = false;
  error = '';
  returnUrl = '/';

  form = this.fb.group({
    email: ['', [Validators.required, Validators.email]],
    password: ['', [Validators.required, Validators.minLength(3)]],
    role: ['Member'], // or 'Admin'
  });

  constructor(
    private fb: FormBuilder,
    private route: ActivatedRoute,
    private router: Router,
    private auth: AuthService
  ) {}

  ngOnInit(): void {
    const ru = this.route.snapshot.queryParamMap.get('returnUrl');
    if (ru) this.returnUrl = ru;
  }

  submit() {
    this.error = '';
    if (this.form.invalid) {
      this.form.markAllAsTouched();
      return;
    }
    this.loading = true;

    const v = this.form.getRawValue();
    const ok = this.auth.login(v.email!, v.password!, (v.role as 'Admin' | 'Member') ?? 'Member');

    this.loading = false;
    if (ok) this.router.navigateByUrl(this.returnUrl);
    else this.error = 'Invalid credentials';
  }

  quickAdmin() {
    if (this.auth.loginAsAdmin()) this.router.navigateByUrl(this.returnUrl);
  }
  quickMember() {
    if (this.auth.loginAsMember()) this.router.navigateByUrl(this.returnUrl);
  }
}
<div class="mx-auto max-w-md p-6">
  <h1 class="text-2xl font-semibold mb-4">Sign in</h1>

  <form [formGroup]="form" (ngSubmit)="submit()" class="space-y-4">
    <div>
      <label class="block text-sm font-medium mb-1">Email</label>
      <input type="email" class="w-full border rounded-lg px-3 py-2" formControlName="email" />
      <div class="text-sm text-red-600" *ngIf="form.controls.email.touched && form.controls.email.invalid">
        Enter a valid email.
      </div>
    </div>

    <div>
      <label class="block text-sm font-medium mb-1">Password</label>
      <input type="password" class="w-full border rounded-lg px-3 py-2" formControlName="password" />
      <div class="text-sm text-red-600" *ngIf="form.controls.password.touched && form.controls.password.invalid">
        Password is required (min 3 chars).
      </div>
    </div>

    <div>
      <label class="block text-sm font-medium mb-1">Role</label>
      <select class="w-full border rounded-lg px-3 py-2" formControlName="role">
        <option value="Member">Member</option>
        <option value="Admin">Admin</option>
      </select>
    </div>

    <div *ngIf="error" class="rounded-md border border-red-200 bg-red-50 p-3 text-red-700">
      {{ error }}
    </div>

    <button type="submit" class="w-full rounded-lg bg-black text-white py-2" [disabled]="loading">
      {{ loading ? 'Signing in…' : 'Sign in' }}
    </button>
  </form>

  <div class="mt-4 flex gap-2">
    <button class="px-3 py-2 rounded border" (click)="quickMember()">Quick: Member</button>
    <button class="px-3 py-2 rounded border" (click)="quickAdmin()">Quick: Admin</button>
  </div>
</div>
